  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: '创建腾讯 TKE 集群',
	description: '您可以使用 Rancher 创建一个托管于 Tencent Kubernetes Engine（TKE）中的集群。Rancher 已经为 TKE 实现并打包了针对 TKE 的集群驱动，但是默认情况下，这个集群驱动是`未启用的`。为了启动 TKE 集群，您需要先启用 TKE 集群驱动程序。启用集群驱动后，可以开始配置 TKE 集群。',
	keywords: [
		'rancher 2.0中文文档',
		'rancher 2.x 中文文档',
		'rancher中文',
		'rancher 2.0中文',
		'rancher2',
		'rancher教程',
		'rancher中国',
		'rancher 2.0',
		'rancher2.0 中文教程',
		'创建集群',
		'创建托管集群',
		'创建腾讯 TKE 集群'
	]
};
export const metadata = {
  "id": "rancher2/cluster-provisioning/hosted-kubernetes-clusters/tke/_index",
  "title": "创建腾讯 TKE 集群",
  "description": "您可以使用 Rancher 创建一个托管于 Tencent Kubernetes Engine（TKE）中的集群。Rancher 已经为 TKE 实现并打包了针对 TKE 的集群驱动，但是默认情况下，这个集群驱动是`未启用的`。为了启动 TKE 集群，您需要先启用 TKE 集群驱动程序。启用集群驱动后，可以开始配置 TKE 集群。",
  "source": "@site/docs/rancher2/cluster-provisioning/hosted-kubernetes-clusters/tke/_index.md",
  "permalink": "/docs/rancher2/cluster-provisioning/hosted-kubernetes-clusters/tke/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/rancher2/cluster-provisioning/hosted-kubernetes-clusters/tke/_index.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055
};
  /* @jsx mdx */

export const rightToc = [{
  value: '先决条件',
  id: '先决条件',
  children: []
}, {
  value: '创建 TKE 集群',
  id: '创建-tke-集群',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p><em parentName="p">{`从 v2.2.0 开始可用`}</em></p>
    <p>{`您可以使用 Rancher 创建一个托管于 Tencent Kubernetes Engine（TKE）中的集群。Rancher 已经为 TKE 实现并打包了针对 TKE 的`}<a parentName="p" {...{
        "href": "/docs/rancher2/admin-settings/drivers/cluster-drivers/_index"
      }}>{`集群驱动`}</a>{`，但是默认情况下，这个集群驱动是`}<inlineCode parentName="p">{`未启用的`}</inlineCode>{`。为了启动 TKE 集群，您需要先`}<a parentName="p" {...{
        "href": "/docs/rancher2/admin-settings/drivers/cluster-drivers/_index"
      }}>{`启用 TKE 集群驱动程序`}</a>{`。启用集群驱动后，可以开始配置 TKE 集群。`}</p>
    <h3 {...{
      "id": "先决条件"
    }}>{`先决条件`}</h3>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意`}</strong>{`
创建腾讯 TKE 集群会产生费用。`}</p>
    </blockquote>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`请确保您将用于创建 TKE 集群的帐户具有适当的权限，详细信息请参考`}<a parentName="p" {...{
            "href": "https://cloud.tencent.com/document/product/598/10600"
          }}>{`云访问管理`}</a>{`文档。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`创建`}<a parentName="p" {...{
            "href": "https://console.cloud.tencent.com/capi"
          }}>{`云 API 密钥 ID 和密钥`}</a>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`在您要部署 Kubernetes 集群的区域中创建`}<a parentName="p" {...{
            "href": "https://cloud.tencent.com/document/product/215/4927"
          }}>{`专用网络和子网`}</a>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`创建`}<a parentName="p" {...{
            "href": "https://cloud.tencent.com/document/product/213/6092"
          }}>{`SSH 密钥对`}</a>{`，此密钥用于访问 Kubernetes 集群中的节点。`}</p>
      </li>
    </ol>
    <h3 {...{
      "id": "创建-tke-集群"
    }}>{`创建 TKE 集群`}</h3>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`从 `}<strong parentName="p">{`集群`}</strong>{` 页面，单击 `}<strong parentName="p">{`添加集群`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`选择 `}<strong parentName="p">{`Tencent TKE`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`输入 `}<strong parentName="p">{`集群名称`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`通过`}<strong parentName="p">{`成员角色`}</strong>{`来设置用户访问集群的权限。`}</p>
        <ul parentName="li">
          <li parentName="ul">{`单击`}<strong parentName="li">{`添加成员`}</strong>{`将需要访问这个集群的用户添加到成员中。`}</li>
          <li parentName="ul">{`在`}<strong parentName="li">{`角色`}</strong>{`下拉菜单中选择每个用户的权限。`}</li>
        </ul>
      </li>
      <li parentName="ol">
        <p parentName="li">{`为 TKE 集群配置`}<strong parentName="p">{`帐户访问`}</strong>{`。使用`}<a parentName="p" {...{
            "href": "#%E5%85%88%E5%86%B3%E6%9D%A1%E4%BB%B6"
          }}>{`先决条件`}</a>{`中获得的信息完成每个下拉列表和字段。`}</p>
        <table parentName="li">
          <thead parentName="table">
            <tr parentName="thead">
              <th parentName="tr" {...{
                "align": "left"
              }}>{`选项`}</th>
              <th parentName="tr" {...{
                "align": "left"
              }}>{`描述`}</th>
            </tr>
          </thead>
          <tbody parentName="table">
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`区域`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`从下拉列表中选择要在其中构建集群的地理区域。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`Secret ID`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`输入从腾讯云控制台获取的 Secret ID。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`Secret Key`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`输入从腾讯云控制台获取的 Secret key。`}</td>
            </tr>
          </tbody>
        </table>
      </li>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<inlineCode parentName="p">{`下一步：配置集群`}</inlineCode>{` 来设置您的 TKE 集群配置。`}</p>
        <table parentName="li">
          <thead parentName="table">
            <tr parentName="thead">
              <th parentName="tr" {...{
                "align": "left"
              }}>{`选项`}</th>
              <th parentName="tr" {...{
                "align": "left"
              }}>{`描述`}</th>
            </tr>
          </thead>
          <tbody parentName="table">
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`Kubernetes 版本`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`TKE 现在只支持 Kubernetes 版本 1.10.5。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`节点数量`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`输入您希望为 Kubernetes 集群购买的工作节点数量，最多 100 个。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`VPC`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`选择您在腾讯云控制台中创建的 VPC 名称。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`容器 CIDR 网络`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`输入 Kubernetes 集群的 CIDR 范围，您可以在腾讯云控制台的 VPC 服务中查看 CIDR 的可用范围。默认 172.16.0.0/16。`}</td>
            </tr>
          </tbody>
        </table>
      </li>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<inlineCode parentName="p">{`下一步：选择实例类型`}</inlineCode>{` 选择将用于 TKE 集群的实例类型。`}</p>
        <table parentName="li">
          <thead parentName="table">
            <tr parentName="thead">
              <th parentName="tr" {...{
                "align": "left"
              }}>{`选项`}</th>
              <th parentName="tr" {...{
                "align": "left"
              }}>{`描述`}</th>
            </tr>
          </thead>
          <tbody parentName="table">
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`可用区`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`选择 VPC 的可用区。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`子网`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`选择在 VPC 中创建的子网，如果在选择的可用区中没有子网，则添加一个新的子网。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`实例类型`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`从下拉菜单中选择要用于 TKE 集群的 VM 实例类型，默认为 S2.MEDIUM4 (CPU 2 Memory 4 GiB)。`}</td>
            </tr>
          </tbody>
        </table>
      </li>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<inlineCode parentName="p">{`下一步：配置实例`}</inlineCode>{` 配置将用于 TKE 集群的 VM 实例。`}</p>
        <table parentName="li">
          <thead parentName="table">
            <tr parentName="thead">
              <th parentName="tr" {...{
                "align": "left"
              }}>{`选项`}</th>
              <th parentName="tr" {...{
                "align": "left"
              }}>{`描述`}</th>
            </tr>
          </thead>
          <tbody parentName="table">
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`操作系统`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`操作系统的名称，当前支持 Centos7.2x86_64 或 ubuntu16.04.1 LTSx86_64。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`安全组`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`安全组 ID，默认不绑定任何安全组。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`根磁盘类型`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`系统磁盘类型。系统磁盘类型限制详见`}<a parentName="td" {...{
                  "href": "https://cloud.tencent.com/document/product/213/11518"
                }}>{`CVM 实例配置`}</a>{`。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`根磁盘大小`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`系统磁盘大小。Linux 系统调整范围为 20-50G，步长为 1。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`数据磁盘类型`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`数据磁盘类型，SSD 云驱动器的默认值。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`数据磁盘大小`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`数据磁盘大小（GB），步长为 10。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`带宽类型`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`带宽类型、按流量计费或按小时计费。`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`带宽`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`公网带宽（Mbps）`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`密钥对`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`密钥 id，在关联密钥后可以用来登录到 VM 节点。`}</td>
            </tr>
          </tbody>
        </table>
      </li>
      <li parentName="ol">
        <p parentName="li">{`单击 `}<strong parentName="p">{`创建`}</strong>{`。`}</p>
      </li>
    </ol>
    <p><strong parentName="p">{`结果：`}</strong></p>
    <ul>
      <li parentName="ul">{`您的集群创建成功并进入到`}<strong parentName="li">{`Provisioning`}</strong>{`（启动中）的状态。Rancher 正在拉起您的集群。`}</li>
      <li parentName="ul">{`在集群状态变为`}<strong parentName="li">{`Active`}</strong>{`（激活）状态后，您将可以开始访问您的集群。`}</li>
      <li parentName="ul">{`在`}<strong parentName="li">{`Active`}</strong>{`的集群中，有两个默认项目：`}<inlineCode parentName="li">{`Default`}</inlineCode>{`项目（包括`}<inlineCode parentName="li">{`default`}</inlineCode>{`命名空间）和`}<inlineCode parentName="li">{`System`}</inlineCode>{`项目（包括`}<inlineCode parentName="li">{`cattle-system`}</inlineCode>{`、`}<inlineCode parentName="li">{`ingress-nginx`}</inlineCode>{`、`}<inlineCode parentName="li">{`kube-public`}</inlineCode>{` 和 `}<inlineCode parentName="li">{`kube-system`}</inlineCode>{`）。`}</li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
